        <title>~~ Login ~~</title>

        <link href="_css/bootstrap.min.css" rel="stylesheet">
        <link href="_css/ie10-viewport-bug-workaround.css" rel="stylesheet">

    <body>
        
        <div class="container"> 

            <form class="form-signin" method="POST" id="formulario">
                <div id="corpo">
                    <img src="_imagens/logo-grande.png" class="img-responsive" width="400" height="388" alt="logo-grande" id="logo"/> 
                <!--/div>
                <div id="corpo"-->
                    <!--h2 class="form-signin-heading text-center" >Login</h2-->
                    <br><br><br>
                <fieldset class="scheduler-border">
                <legend class="scheduler-border">Login: </legend>
                    <label for="usuario" class="sr-only">usuario</label>
                    <input type="text" id="usuario" name="usuario" class="form-control" placeholder="Digitar o usuário..." required autofocus>
                    <br/>
                    <label for="senha" class="sr-only">senha</label>
                    <input type="password" id="senha" name="senha" class="form-control" placeholder="Digitar a senha..." required>

                    <div class="checkbox">
                        <label>
                            <input type="checkbox" value="lembarMe"> Lembrar Senha
                        </label>
                    </div>
                    <button type="submit" id="botaoLogin" class="btn btn-lg btn-warning btn-block">Entrar</button>
                </fieldset>
                    
                </div>
            </form>
        
            
            <div class="alert alert-danger" id="erroLogin" role="alert" style="display:none;">
                <button type="button" class="close" data-dismiss="alert" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
                <strong>Usuário ou senha incorretos!</strong> &nbsp;Digite novamente, ou entre em contato com o suporte.
            </div>
            <div class="alert alert-info" id="msgSuporte" role="alert" style="display:none;">
                <button type="button" class="close" data-dismiss="alert" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
                <strong>Contato</strong> &nbsp;suporte@fundetec.org.br
            </div>
            <div class="alert alert-success" id="msgLogado" role="alert" style="display:none;">
                <button type="button" class="close" data-dismiss="alert" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
                <strong>Login:</strong> &nbsp;Sucesso!
            </div>
            
        </div> <!-- /container -->
